form the users about taking a walk between the hours of 5pm and 7pm or exercising or jogging because analysis shows these are their active hours. This exercise could reduce the risk of having a heart attack.\n","4. Users could set goals on the number of calories they want to burn. Bellabeat will use this opportunity to motivate them by informing them on the amount of steps remaining for them to reach that goal."]},{"cell_type":"markdown","id":"1fa703ec","metadata":{"papermill":{"duration":0.014235,"end_time":"2022-08-09T10:43:18.817198","exception":false,"start_time":"2022-08-09T10:43:18.802963","status":"completed"},"tags":[]},"source":["![ cool ](https://img.freepik.com/free-photo/group-women-running-park_1301-7606.jpg?t=st=1649534686~exp=1649535286~hmac=cb7eb2c3c0d65659252bbfbe2d5c8993e495ac1dc991af122a5968cf61f6446a) ![]()"]},{"cell_type":"markdown","id":"cc47e54b","metadata":{"papermill":{"duration":0.01379,"end_time":"2022-08-09T10:43:18.845676","exception":false,"start_time":"2022-08-09T10:43:18.831886","status":"completed"},"tags":[]},"source":["We these few recommendations the Bellabeat company will experience growth and better accuracy when making informed decisions and this will go a long way in showing the users that we value them and consider their health and well being as top most priority. The app is user friendly, easy to use and get perfect day by day. I also suggest a referral scheme, where users write their experiences with the product, for example how it helped them and they will get rewarded. This could boost help them develop a better marketing strategy and also boost their sales"]},{"cell_type":"markdown","id":"2bacc775","metadata":{"papermill":{"duration":0.013825,"end_time":"2022-08-09T10:43:18.873313","exception":false,"start_time":"2022-08-09T10:43:18.859488","status":"completed"},"tags":[]},"source":["How did i go ? Feel free to lay your comments, I will deeply appreciate this😊.\n","\n","PS: My first Project"]}],"metadata":{"kernelspec":{